function Board(){
    return(
        <div className="board">
            <img className="board-playing-card" src={CardBack}/>
            <img className="board-playing-card" src={CardBack}/>
            <img className="board-playing-card" src={CardBack}/>
            <div style={{width: "2em"}}/>
            <img className="board-playing-card" src={CardBack}/>
            <div style={{width: "2em"}}/>
            <img className="board-playing-card" src={CardBack}/>
        </div>
    )
}

export default Board;
